Foxit Readeris a free PDF document viewer and printer, with incredible small size, breezing-fast launch speed and amazingly rich feature set. In the past, you have to download a huge PDF Reader from another software company, go through a lengthy installation process and wait for an annoying splash window to disappear just to open a PDF document. Moreover

Foxit PDF Reader is the only eligible alternative reader/viewer for PDF files (eBooks). It's free, smaller, faster, and cleaner. And it starts up immediately, so you don't need to wait the annoying &quot;Welcome&quot; screen to disappear. Foxit PDF Reader is extremely easy to use, just double click it to start and then click open button to open your PDF document. If you want to print, click on &quot;Print&quot; button. If you want to setup the page layout for printing, select &quot;Print Setup&quot; from &quot;File&quot; menu. Foxit Reader supports Windows 98/Me/2000/XP/2003/Vista/7
